import React, { Component, useEffect, useState } from "react";
import {ImagemDesign, Card, Card2} from '../Styles/Style';
import semaforo from '../assets/semaforo.png';
import styles from '../Styles/'

const ListaControladores = (props) => {

  return (
        <Card2>
              <p> <ImagemDesign src={semaforo} /> Controladores </p>
              <p>Nome: {props.controlers.name}</p>
              <p>ID: {props.controlers.id}</p>
              <p>Lat: {props.controlers.latitude}</p>
              <p>Long: {props.controlers.longitude}</p>
              <p>Descricao: {props.controlers.description}</p>
              {/* <p>Nome: {props.teste.name}</p>
              <p>ID: {props.teste.id}</p> */}
          </Card2>
  )
}

export default ListaControladores;
